import React from 'react';
import './UsefulServices.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faCalendarAlt, 
  faBaby, 
  faHeart, 
  faThermometerHalf 
} from '@fortawesome/free-solid-svg-icons';

const UsefulServices = () => {
  const services = [
    {
      icon: faCalendarAlt,
      text: 'Календарь\nовуляции',
      color: 'orange'
    },
    {
      icon: faBaby,
      text: 'Календарь\nбеременности',
      color: 'pink'
    },
    {
      icon: faHeart,
      text: 'Рассчитать\nдату родов',
      color: 'green'
    },
    {
      icon: faThermometerHalf,
      text: 'Графики базальной\nтемпературы',
      color: 'purple'
    }
  ];

  return (
    <div className="useful-services">
      <h3>Полезные сервисы</h3>
      <div className="services-list">
        {services.map((service, index) => (
          <div key={index} className="service-item">
            <div className={`service-icon ${service.color}`}>
              <FontAwesomeIcon icon={service.icon} />
            </div>
            <span>{service.text}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default UsefulServices;
